import { makeStyles } from '@mui/styles';

export const useStyles = makeStyles({
    swap: {
        color: '#fff', 
        border: 2, 
        borderRadius: '50%', 
        borderColor: '#fff', 
        backgroundColor: '#000'
    },
    lang_bar: {
        bgcolor: '#ABE3FF', 
        height: '10vh', 
        border: 1, 
        borderRadius: 2
    }
});
